import React from "react";

function SettingImageWithAbsoluteValue({
  imgUrl,
  top = "auto",
  bottom = "auto",
  right = "auto",
  left = "auto",
}) {

  return (
    <div
      className=""
      style={{
        position: "absolute",
        zIndex: -1,
        top: top === "auto" ? `auto` : `${top}px`,
        right: right === "auto" ? `auto` : `${right}px`,
        left: left === "auto" ? `auto` : `${left}px`,
        bottom: bottom === "auto" ? `auto` : `${bottom}px`,
      }}
    >
      <img src={imgUrl} alt="#" />
    </div>
  );
}

export default SettingImageWithAbsoluteValue;
